import React, { useState, useEffect } from 'react';
import axios from 'axios';

const FeedbackDetailsPage = () => {
  const [feedbacks, setFeedbacks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      try {
        const response = await axios.get(`http://localhost:3000/feedback`);
        console.log('Feedback Response:', response.data);
        setFeedbacks(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
        setError(`Error fetching data: ${error.message}`);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) return <div>Loading...</div>;
  if (error) return <div>{error}</div>;
  if (feedbacks.length === 0) return <div>No feedback found</div>;

  const formatDate = (dateString) => {
    if (!dateString) return 'N/A';
    return new Date(dateString).toLocaleDateString();
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1 style={{ textAlign: 'center', marginBottom: '20px' }}>Feedback Details</h1>
      <div style={{ overflowX: 'auto' }}>
        <table style={{ width: '100%', borderCollapse: 'collapse' }}>
          <thead>
            <tr style={{ backgroundColor: '#f2f2f2' }}>
              <th style={tableHeaderStyle}>Institution Name</th>
              <th style={tableHeaderStyle}>Website</th>
              <th style={tableHeaderStyle}>Visit Date</th>
              <th style={tableHeaderStyle}>Staff Name</th>
              <th style={tableHeaderStyle}>Staff Email</th>
              <th style={tableHeaderStyle}>Staff Mobile</th>
              <th style={tableHeaderStyle}>Total Students</th>
              <th style={tableHeaderStyle}>Accompanying Staff</th>
              <th style={tableHeaderStyle}>IPR Rating</th>
              <th style={tableHeaderStyle}>FCIPT Rating</th>
              <th style={tableHeaderStyle}>Knowledge</th>
              <th style={tableHeaderStyle}>Explanations IPR</th>
              <th style={tableHeaderStyle}>Explanations FCIPT</th>
              <th style={tableHeaderStyle}>Knowledge Before</th>
              <th style={tableHeaderStyle}>Knowledge After</th>
              <th style={tableHeaderStyle}>Technical Contents</th>
              <th style={tableHeaderStyle}>Ease of Understanding</th>
              <th style={tableHeaderStyle}>Sources</th>
              <th style={tableHeaderStyle}>Campuses</th>
              <th style={tableHeaderStyle}>Best</th>
              <th style={tableHeaderStyle}>Worst</th>
              <th style={tableHeaderStyle}>Suggestions</th>
              <th style={tableHeaderStyle}>Comments</th>
              <th style={tableHeaderStyle}>Created At</th>
              <th style={tableHeaderStyle}>Updated At</th>
            </tr>
          </thead>
          <tbody>
            {feedbacks.map((feedback, index) => (
              <tr key={index} style={{ backgroundColor: index % 2 === 0 ? '#ffffff' : '#f9f9f9' }}>
                <td style={tableCellStyle}>{feedback.institutionName || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.website || 'N/A'}</td>
                <td style={tableCellStyle}>{formatDate(feedback.visitDate)}</td>
                <td style={tableCellStyle}>{feedback.staffName || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.staffEmail || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.staffMobile || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.totalStudents || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.accompanyingStaff || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.ratings?.iprRating || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.ratings?.fciptRating || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.ratings?.knowledge || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.ratings?.explanationsIPR || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.ratings?.explanationsFCIPT || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.ratings?.knowledgeBefore || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.ratings?.knowledgeAfter || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.ratings?.technicalContents || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.ratings?.easeOfUnderstanding || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.sources?.join(', ') || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.campuses?.join(', ') || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.best || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.worst || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.suggestions || 'N/A'}</td>
                <td style={tableCellStyle}>{feedback.comments || 'N/A'}</td>
                <td style={tableCellStyle}>{formatDate(feedback.createdAt)}</td>
                <td style={tableCellStyle}>{formatDate(feedback.updatedAt)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

const tableHeaderStyle = {
  padding: '12px',
  textAlign: 'left',
  borderBottom: '2px solid #ddd',
  fontWeight: 'bold',
};

const tableCellStyle = {
  padding: '12px',
  textAlign: 'left',
  borderBottom: '1px solid #ddd',
};

export default FeedbackDetailsPage;
